import './App.css';

function App() {

 //only js codes inside function
 let a=[1,2,3,4,5]
 let header="new content" //dynamic values
 let url="https://abc"
 let img="https://abc"
 return (  
   //only html codes inside return
    //to differentiate predefined 'class', we use className
   <div className="App"> 
   <img src={img} alt="" />
   <a href={url}></a>
     <h1>{header}</h1>
     <h1>{a}</h1>
     {a.unshift(10)}
     {a++}
   </div>
   //js codes can be used in return body using flower brackets
 );

}

export default App;
